import React from 'react';
import {
  Row,
  Col,
    Container
} from 'reactstrap';
// import Style from '../assets/style'

export default class MainHomepage extends React.Component {
    render(){
        return(
            <div>
                <Container>
                    <h1 style={{textAlign:'center'}}>Langkah Mudah Berinvestasi</h1>
                    <div className="row">
                        <div className="col-sm-3 col-12"></div>
                        <div className="col-sm-3 col-12"></div>
                        <div className="col-sm-3 col-12"></div>
                        <div className="col-sm-3 col-12"></div>
                    </div>
                </Container>
            </div>
        )
    }
}
